script: |
  super -f tsv -I q2629.sql | sort > q2629.out

vector: true

inputs:
  - name: q2629.sql
    data: |
      SELECT 20 AS col2 FROM tab1 AS cor0 WHERE NOT ( - col0 * col2 ) BETWEEN CAST ( + col0 AS INTEGER ) AND - col2 * + 43 + + col0;
  - name: tab1

outputs:
  - name: q2629.out
    data: |
      20
      20
      20
